        value=""
      />
      <div className="send">
        <img src="" alt="" />
        <input
          type="file"
          style={{ display: "none" }}
          id="file"/>
          
        
        
        <button onClick="">Send</button>
        <button onClick="">
        <EmojiPicker />
        </button>
        
      </div>
    </div>
  )
}

export default Input
